VALUES ('3258561170190', 'Melange 4 huiles vegetales', 'huile de colza (60%), huile de tournesol à haute teneur en acide oléique (20%), huile de tournesol (15%), huile de pépins de raisins (5%), Vitamine D. Conseils d\'utilisation : utilisation possible en assaisonnement cuisson et friture (température maximale conseillée en friture : 1800C). Introduire les aliments doucement lorsque l\'huile est à bonne température. Renouveler la totalité du bain après 10 fritures.Teneuren vitamine D fortement réduite en cuisson. Ne pas laisser fumer l\'huile, Conservation : à conserver ù l\'abri de la chaleur et de la lumière. Bien reboucher après usage. A consommer de préférence avant fin:vfl sur la bouteille.', 'https://static.openfoodfacts.org/images/products/325/856/117/0190/front_fr.4.400.jpg', '100', '8', '0', '0', '0', '0', '0', '0', '', '0');

