VALUES ('3258561240237', 'Cassoulet', 'Sauge : eau, concentré de tomate, farine de blé. sele ail et oignon en poudret sucre, poivre, Harjcots blancs : saucisses et saucissons précuits (pièces de tète de porc, eau, viande de votaille séparée mécaniquement, gras de porc, farine de blé, sel, plasma de porc déshydraté, couennes, ail et oignon en poudre, protéines de lait, épice et plante aromatique I gélifiant: E407,stabilisant: E451, antioxydant: E316, conservateur : E250), viande de porc traitée en salaison (viande de porc, eau, sel, dextrose. stabilisant : E451, gélifiant : E407, conservateur. E250). Fabriqué dans un atelier utilisant : céleri, moutarde, œuf, poisson, crustacés et mollusques. Viande de porc (origine UE).', 'https://static.openfoodfacts.org/images/products/325/856/124/0237/front_fr.4.400.jpg', '4.6', '1.69', '12.1', '1.1', '', '1.2', '0.8', '0.31496062992126', '', '1');

