VALUES ('3258561240251', 'Saucisse aux lentilles cuisinés', 'Sauce : eau, saindoux, concentré de tomate, vinaigre de vin, sel, arômes naturels, gélifiants : farine de graine de caroube et gomme guar. Lentilles et petits légumes : lentilles précuites (30%), carottes (3%), oignons (2%). Saucisses fumées (18%)(viande et gras de pore viande de dinde*, eau, couenne de porc, farine de BLE, pièces de tête de porc, sel, protéines de SOJA, gélifiant : E407a, stabilisants : EGO, E452, arômes naturels, coriandre, traces de protéines de LAIT). ', 'https://static.openfoodfacts.org/images/products/325/856/124/0251/front_fr.4.400.jpg', '4.6', '1.9', '7.5', '0.6', '', '6.4', '0.899999999999999', '0.354330708661417', '', '1');

